This stunning saree and others like it are available for purchase, and considering the labor intensive process, and completely natural paints, I feel these pieces are priced extremely reasonably. Akshay also paints on cotton and tussar. Akshay can be reached directly on WhatsApp at +91 85114 08702. I was so personally moved by his art that I feel he deserves recognition for his work. 

Mata-Ni-Pachedi literally means behind the Mother Goddess, and is a Gujarati art form originating from social discrimination. Marginalized and barred from entering temples, the nomadic Vaghari peoples created their own depictions of the Mother Goddess on cloth, and hung them behind temples for worship. This artwork has a sacred meaning with an old origination, at least 300 years old, if not older. 

Artist: Akshay Dilip Chitara, @akshaychitara2 
WhatsApp: +91 85114 08702

